Here is the fixed unit test:

```java
package original;

import org.junit.Test;
import static org.junit.Assert.*;
import java.util.Arrays;
import java.util.List;

public class MedianTest {

    @Test
    public void testMedianOddSizeList() {
        List<Integer> list = Arrays.asList(1, 3, 2);
        Number result = Median.median(list);
        assertEquals(2, result);
    }

    @Test
    public void testMedianEvenSizeList() {
        List<Integer> list = Arrays.asList(1, 3, 2, 4);
        Number result = Median.median(list);
        assertEquals(2.5, result);
    }

    @Test
    public void testMedianEmptyList() {
        List<Integer> list = Arrays.asList();
        Number result = Median.median(list);
        assertNull(result);
    }

    @Test
    public void testMedianSingleElementList() {
        List<Integer> list = Arrays.asList(5);
        Number result = Median.median(list);
        assertEquals(5, result);
    }

    @Test
    public void testMedianDuplicateElements() {
        List<Integer> list = Arrays.asList(2, 2, 2, 2);
        Number result = Median.median(list);
        assertEquals(2.0, result);
    }
}
```

The error in the `testMedianDuplicateElements` test was fixed by changing the expected value from `2` to `2.0` to match the actual result.

The error in the `testMedianEmptyList` test was fixed by providing an empty list as the input to the `median` method.
